import React from 'react'
import * as ReactGoogleCharts from 'react-google-charts'

class SensorHistoryGraph extends React.Component {
  render () {
    return (
      <ReactGoogleCharts.Chart chartType="Line" data={
        [
          ['Time', 'Temperature', 'pH', 'Salinity'],
          [new Date(1569951085000), 15, 7.4, 5.1],
          [new Date(1569949200000), 5, 7.6, 4.7],
          [new Date(1572566400000), 16, 8.1, 6.2]
        ]
      }></ReactGoogleCharts.Chart>
    )
  }
}

export default SensorHistoryGraph
